import React from 'react';
import classes from ".//Footer.module.sass"
import Container from './Container';
const Footer = () => {
    return (
        <div className={classes.Footer}>
            <Container inner={
                <div className={classes.Footer__inner}>
                    <div className={classes.Footer__inner__top}>
                        <div className={classes.Footer__inner__top__btn}>
                            <p></p>
                            <div className={classes.Footer__inner__top__btn}/>
                        </div>
                    </div>
                    <div className={classes.Footer__inner__br}/>
                    <div className={classes.Footer__inner__logo}></div>
                    <div className={classes.Footer__inner__text}></div>
                </div>
            }/>
        </div>
    );
};

export default Footer;
